//Dependencies
import React from 'react';
//Internals
import MenItems from './MenItems';
import './index.css';

const MensProducts = () => (
  <div className="mens-products">
    <div className="mens-title">
      <h4>Men's Items</h4>
    </div>
    <MenItems />
  </div>
);


export default MensProducts;
